// Define the pet ID
const petId = 1;
// Use the fixture method to read the image file from the cypress fixtures folder
cy.fixture('pet2.jpg', 'binary').then(fileContent => {
  const blob = Cypress.Blob.binaryStringToBlob(fileContent, 'image/jpeg');
  // Manually create a FormData object and append the image
  const formData = new FormData();
  formData.append('file', blob, 'pet2.jpg');
  // Convert FormData to a form-data readable stream
  cy.request({
    method: 'POST',
    url: `/pet/${petId}/uploadImage`,
    // Upload image to the pet
    headers: {
      'Content-Type': 'multipart/form-data'
    },
    formData: {
      file: blob
    },
    failOnStatusCode: false
  }).then(response => {
    // Log the entire response to inspect it
    cy.log('Full response:', JSON.stringify(response));
    // Check if the response body and message exist
    if (response.body && response.body.message) {
      const responseMessage = response.body.message;
      // Log the response message
      cy.log(`Response Message: ${responseMessage}`);
      // Assert that the response contains the expected message
      expect(responseMessage).to.include('File uploaded to ./pet2.jpg');
      expect(response.status).to.equal(200); // Assert that the status code is 200
    } else {
      // Log and throw an error if the message is not present
      cy.log('Response body or message is undefined');
      throw new Error('Response body or message is missing');
    }
  }).catch(err => {
    cy.log(`Request failed: ${err.message}`);
  });
});
